import React from "react";
import { BsInfoCircleFill } from "react-icons/bs";
import PageHeaderContent from "../../components/pageHeaderContent";
import { skillsData } from "./utils";
import { Line } from "rc-progress"; // Ensure this is imported
import { Animate, AnimateKeyframes } from "react-simple-animate";
import "./style.scss";

const Skills = () => {
    return (
        <section id="skills" className="skills">
            <PageHeaderContent
                headerText="My Skills"
                icon={<BsInfoCircleFill size={40} />}
            />
            <div className="skills__content-wrapper">
                {skillsData.map((item, key) => (
                    <div className="skills__content-wrapper__inner-content" key={key}>
                        <Animate
                            play
                            duration={1}
                            delay={0.3}
                            start={{ transform: "translateX(-200px)" }}
                            end={{ transform: "translateX(0px)" }}
                        >
                            <h3 className="skills__content-wrapper__inner-content__category">
                                {item.label}
                            </h3>
                            <div className="skills__content-wrapper__inner-content__progressbar">
                                {item.data.map((skillItem, j) => (
                                    <AnimateKeyframes
                                        play
                                        duration={1}
                                        keyframes={["opacity:1", "opacity:0"]}
                                        iterationCount="1"
                                        key={j}
                                    >
                                        <div className="progressbar-wrapper">
                                            <p>{skillItem.skillName}</p>
                                            <Line
                                                percent={skillItem.skillPercentage}
                                                strokeWidth="2"
                                                strokeColor="var(--yellow-theme-main-color)"
                                                trailWidth="2"
                                                strokeLinecap="square"
                                            />
                                        </div>
                                    </AnimateKeyframes>
                                ))}
                            </div>
                        </Animate>
                    </div>
                ))}
            </div>
        </section>
    );
};

export default Skills;
